import { Link } from 'react-router-dom';

import './navbar.css'
import { logo } from '../imagesdep';
function Navbar(){
  function handelchange(){
    let links=document.querySelectorAll(".nav-link");
    document.querySelectorAll(".nav-link").forEach((ele)=>{
      ele.onClick=function(){
        document.querySelectorAll(".nav-link").forEach((ele)=>{
          ele.classList.remove("active");
        })
        ele.classList.add("active");
      }
    })
  }
  return (
<nav className="navbar navbar-expand-lg navbar-light bg-light">
  <div className="container-fluid nav-container">
    <Link className="navbar-brand logo" to="/">
      <img src={logo} alt="logo" />
    </Link>
    <div className="collapse navbar-collapse links" id="navbarSupportedContent">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0 links">
        <li className="nav-item">
          <Link className="nav-link active" aria-current="page" to="/" onClick={handelchange}>Home</Link>
        </li>
        <li className="nav-item">
          <Link className="nav-link" to={'/explorepage'} onClick={handelchange}>Explore</Link>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="/details" onClick={handelchange}>Item Details</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="/author" onClick={handelchange}>Author</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="/creat" onClick={handelchange}>Creat Yours</a>
        </li>
      </ul>
    </div>
  </div>
</nav>
  )
}
export default Navbar;
